          className: 'edit-btn',
          onClick: () => setIsEditing(!isEditing)
        },
        isEditing ? 'üîí Lock' : '‚úèÔ∏è Edit'
      ),
      React.createElement(
        'button',
        {
          className: 'close-btn',
          onClick: onClose
        },
        '‚ùå Close'
      )
