          'div',
          { className: 'info-grid compact' },
          React.createElement(
            'div',
            { className: 'info-item' },
            React.createElement('strong', null, 'NAME: '),
            studentData ? 
              `${studentData.last_name}, ${studentData.first_name} ${studentData.middle_name || ''}`.toUpperCase() :
              'BAYLON, MARK CHRISTIAN MACASABUANG'
          ),
          React.createElement(
            'div',
