                  isEditing ?
                    React.createElement('input', {
                      type: 'number',
                      value: course.lec,
                      onChange: (e) => handleEditCourse(index, 'lec', parseInt(e.target.value) || 0),
                      className: 'edit-input x-small'
                    }) :
                    course.lec
