                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'number',
                      value: course.lab,
                      onChange: (e) => handleEditCourse(index, 'lab', parseInt(e.target.value) || 0),
